import React from "react";
import "./CertificateCard.css";
// import KubernetesCert from "../../assets/images/certificates/";

const CertificateCard = ({ name, org, date, credential_url, id, image }) => {
  // const imagefile = require(`../../assets/images/certificates/${image}`);
  return (
    <div className="CertificateCard">
      <a href={credential_url} rel="noopener noreferrer" target="_blank">
        {/* <img src={imagefile} alt={name} /> */}
      </a>
      <h3>
        <a href={credential_url} rel="noopener noreferrer" target="_blank">
          {name}
        </a>
      </h3>
      <p className="CertDate">{date}</p>
      <p>{org}</p>
    </div>
  );
};

export default CertificateCard;
